body:
**Description**: Add extensible design for session options (design extends to run options - although not supported yet) to be parsed from a model (if available). The `metadata_props` field in the ModelProto would hold a Json containing session options (and in future run options).  Only 5 session options are currently supported (**intra_op_num_threads**, **inter_op_num_threads**, **enable_profiling**, **execution_mode**, and **graph_optimization_level**). Looking into the model for session options will be triggered only if the environment variable  - ORT_LOAD_CONFIG_FROM_MODEL is set 1.

Sample Json available via the Model Proto:

    metadata_props["ort_config"] =
    "{
		"session_options": {
			"intra_op_num_threads": 5,
			"enable_profiling": 1
		}
    }"

**Motivation and Context**
Requested by an internal Microsoft team
